  "description": {
    "nb": "Datasettet Forsvarets skyte- og øvingsfelt i sjø (SØF i sjø) viser Forsvarets øvingsområder til sjøs. Øvingsfeltene representerer tilrettelagte områder hvor Forsvaret sammen med allierte kan øve og trene operasjoner i alle dimensjoner; luft, overflate, under vann og under alle værforhold. Virksomheten er konsentrert til definerte øvingsområder både innenfor grunnlinjen og til havs. SØF i sjø er sentrale arealer for den operative virksomheten hvor aktiviteten består i å trene, øve, utdanne personell, prøve ut materiell og fartøyer, ivareta alliert øving og trening. \n \nDataene baserer seg i hovedsak på NOU 2004:27 Forsvarets skyte- og øvingsfelt. https://www.regjeringen.no/no/dokumenter/nou2004-27/id388722/. Fra denne publikasjonen er det kun feltene i sjø som inngår i dette datasettet. Øvrige skyte- og øvingsfelt er et eget datasett."
  },
