  "title": {
    "nb": "Avrenning fra Forsvarets skyte- og øvingsfelt"
  },
  "description": {
    "nb": "Bakgrunn og innhold for overvåking av vannforurensning\n\nOvervåking av avrenning av metaller fra skyte- og øvingsfelt (SØF) startet i flere felt i 1991, med prøvetaking av vann og elvemose fra utvalgte bekker. Det ble analysert for bly, kobber og flere vannkjemiske parametere. Resultatene er utgitt i NIVA rapporter, som finnes på www.niva.no. Den siste rapporten fra 2006 ligger på Forsvarsbyggs internettsider (se referanser).\nI 2006 utvidet Forsvarsbygg overvåkingen til å gjelde alle aktive SØF. I perioden 2006-2008 gjennomførte Forsvarsbygg Program Grunnforurensning, der det ble samlet vannprøver fra alle vannveier som forlater SØF. Det ble tatt tre prøverunder i løpet av ett år - i slutten av snøsmeltning, i nedbørrik periode og tørr periode. Det er samlet inn flere hundre vannprøver som er analysert for 11 ulike metaller, hvitt fosfor og ulike typer sprengstoff. Rapporten Program Grunnforurensning er utgitt av Sweco og Forsvarsbygg og er tilgjengelig på Forsvarsbyggs internettsider.\n\nResultater fra overvåkingen\n\nKort fortalt viser resultatene at det er store forskjeller i hvor mye metaller som lekker ut i bekkene i de ulike SØF. Årsak kan både være kjemi i jordsmonnet og hvordan feltet er brukt. For eksempel er surt jordsmonn (myr) ugunstig. Det samme er skyting på harde flater (pulveriserer prosjektilene) samt nærhet til vannvei. Overvåkingen viser og at når det graves på banene øker gjerne utlekkingen av metaller dramatisk. Selv om konsentrasjonene av metaller er høye inni feltene er de stort sett lave på SØF grensen. Dette skyldes at metallene felles ut eller at vannet fortynnes.Det er kun registrert funn av hvitt fosfor i en eneste bekk – og dette er i en bekk i et målområde for hvitt fosfor granater, på Setermoen. Det er kun funnet sprengstoff i to bekker – i Ulven og Mjølfjell SØF. \n\nVidere overvåking\n\nForsvarsbygg fortsetter overvåkingen av avrenning av bly, kobber, antimon og sink i alle skyte- og øvingsfelt for å registrere eventuelle økninger i metallutlekking. Det tas prøver to ganger årlig i feltene med høyest avrenning. Rapportene legges årlig ut på Forsvarsbyggs internettsider."
  },
